const collapseText = document.getElementById("expandText");
const arrow = document.querySelector(".arrow-btn");
collapseText.addEventListener("show.bs.collapse", (event) => {
  arrow.style.transform = "rotateZ(0deg)";
  document.documentElement.lang === 'en' ? document.querySelector('.see-more').innerHTML = 'see less' : document.querySelector('.see-more').innerHTML = 'vezi mai puțin'
});

collapseText.addEventListener("hide.bs.collapse", (event) => {
  arrow.style.transform = "rotateZ(180deg)";
  document.documentElement.lang === 'en' ? document.querySelector('.see-more').innerHTML = 'see more' : document.querySelector('.see-more').innerHTML = 'vezi mai multe'
});

